tables.table_schema:
CREATE TABLE locations (
    location_id INT PRIMARY KEY,
    location_name VARCHAR(50),
    latitude DECIMAL(9,6),
    longitude DECIMAL(9,6)
);

CREATE TABLE network_coverage (
    coverage_id INT PRIMARY KEY,
    location_id INT,
    provider_name VARCHAR(50),
    coverage_strength INT,
    FOREIGN KEY (location_id) REFERENCES locations(location_id)
);

CREATE TABLE location_data (
    id INT PRIMARY KEY,
    latitude DECIMAL(9,6),
    longitude DECIMAL(9,6),
    location_name TEXT
);

CREATE TABLE service_providers (
    id INT PRIMARY KEY,
    provider_name TEXT,
    coverage_status BOOLEAN
);

CREATE TABLE locations (
    location_id INT PRIMARY KEY,
    location_name VARCHAR(255),
    latitude FLOAT,
    longitude FLOAT
);

CREATE TABLE networks (
    network_id INT PRIMARY KEY,
    network_name VARCHAR(255),
    technology VARCHAR(50),
    bandwidth INT
);

CREATE TABLE locations (
    location_id UUID PRIMARY KEY,
    location_name VARCHAR(255),
    latitude FLOAT,
    longitude FLOAT
);

CREATE TABLE signal_strength (
    signal_id UUID PRIMARY KEY,
    location_id UUID,
    signal_strength FLOAT,
    timestamp TIMESTAMP
);

CREATE TABLE network_operators (
    operator_id UUID PRIMARY KEY,
    operator_name VARCHAR(50),
    country VARCHAR(50)
);

CREATE TABLE technologies (
    technology_id UUID PRIMARY KEY,
    technology_name VARCHAR(50),
    frequency FLOAT
);
